yFunc[sab_?MatrixQ,aab_?MatrixQ,calculateInvariants_?BooleanQ]:=Module[{retVal,a,b},
If[calculateInvariants,CalculateYInvariants[sab,aab]];
retVal=Table[(-(SumS12 - I*NNN*SumAx1[[a]] + I*NNN*SumAx1[[b]] - NNN*SumSx1[[a]] - NNN*SumSx1[[b]] + I*NNN^2*aab[[a,b]] + NNN^2*sab[[a,b]])/(2*NNN^2)),{a,1,NNN},{b,1,NNN}];
Return[retVal];
];

